import mock from './src/mocks/colecao' //recebendo os dados do mock

import { NavigationContainer } from '@react-navigation/native'
import Routes from './src/routes';

export default function App() {

  const [fonteCarregada] = useFonts ({ //constante que recebe as fontes
    'MontSerratRegular': Montserrat_400Regular,
    'MontSerratBold': Montserrat_700Bold,
  })

  if (!fonteCarregada) { //se a fonte n√£o estiver carregada, ele retorna uma view vazia(tela branca)
    return <View/>; 
  }

  //return do app (principal)
  return <NavigationContainer style={styles.container}> 
          {/* <Colecao {...mock} /> */}
          <Routes/>
          <Routes />
         </NavigationContainer>; 
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F0FFFF',

  },
});
